import React, { Component } from 'react';
import Map from 'pigeon-maps';
import Marker from 'pigeon-marker';

class ISSLocation extends Component {
  render() {

    return (
      <div>
        <Map
          center={[0, 0]}
          defaultWidth={450}
          height={450}
          minZoom={1}
          maxZoom={8}
          zoom={1.5}
        >
          <Marker />
        </Map>
      </div>
    )
  }
}

export default ISSLocation;

